{
  "advertisements": [
    {
      "date": "1791-01-31",
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "1. Es sucht jemand einen silber Schreybezeug mit aller Zugehör und schöner fason, der Liebhaber ist im Berichthaus zu erfragen."
    },
    {
      "date": "1791-01-31",
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "2. Man begehrt eine Chais mit 2 Achsen zu etwa 3 Plätzen und ein gutes Pferd samt gehörigem Geschirr, der Liebhaber ist im Berichthaus oder Entgelt zu erfragen."
    },
    {
      "date": "1791-01-31",
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "3. Wer über ein oder zwey noch ganz neuen Tröster-Brandweinbrennweihe zu verkaufen weiß, im Berichthaus wird der Käufer zu erfragen seyn."
    },
    {
      "date": "1791-01-31",
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "4. Es sucht jemand ein schönes bewohnbares Häuschen oder ein Haus sammt Garten und einigen Feldern in einem Haupt-Stadttheil hier zu kaufen, der Liebhaber ist im Berichthaus zu erfragen."
    },
    {
      "date": "1791-01-31",
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "5. Es sucht jemand ein ansehnliches Kronleuchter mit 8 Lichtchen, der Liebhaber ist im Berichthaus zu erfragen."
    },
    {
      "date": "1791-01-31",
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "6. Es verlangt jemand eine nicht gar große eisserne Gießkanne, der Liebhaber ist im Berichthaus zu erfragen."
    },
    {
      "date": "1791-01-31",
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "7. Es sucht jemand einen ausbäumern silbergeschirrten Kasten, der Liebhaber ist im Berichthaus zu erfragen."
    },
    {
      "date": "1791-01-31",
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "8. Man verlangt einen noch guten Kachel-Ofen zu kaufen, der nicht über eine Fuß, der Liebhaber ist im Berichthaus zu erfragen; bietet aber keinen Bezug."
    },
    {
      "date": "1791-01-31",
      "tags_section": "Es wird zum Ausleihen offeriert:",
      "ntokens": null,
      "text": "1. Ein Losament mitten im Offenburgers Hofe, wo der Augenschein zeigen wird; auf nächste Fachnacht oder Pfingst-Fronfasten zu beziehen."
    },
    {
      "date": "1791-01-31",
      "tags_section": "Es wird zum Ausleihen offeriert:",
      "ntokens": null,
      "text": "2. Ein wohlgebautes Haus an der Spahn in oberer Stuben und Nebenkammer / oder nach Belieben und Kammern mit Sommerhaus, Sommerschlüssel, alles auf einem Boden, und nach Belieben Stallung, zu beziehen, auf Pfingst-Fronfasten zu beziehen."
    },
    {
      "date": "1791-01-31",
      "tags_section": "Es wird zum Ausleihen offeriert:",
      "ntokens": null,
      "text": "3. Ein Losament mit einem schönen Laden und Laden-Stüblein nebst einem großen Sommerhaus, Stuben, Kuchyn, 2 große Kammern, einem besonderen Keller, Holzhaus, ein beschlossener Hausabgang, auf der Steingass; im Berichthaus zu erfragen."
    },
    {
      "date": "1791-01-31",
      "tags_section": "Es wird zum Ausleihen offeriert:",
      "ntokens": null,
      "text": "4. Ein Losament in der Froschgaß von einer Stuben, 2 Kammern und Platz zum Holz, auf Pfingst-Fronfasten zu beziehen, im Berichthaus zu erfragen."
    },
    {
      "date": "1791-01-31",
      "tags_section": "Es wird zum Ausleihen offeriert:",
      "ntokens": null,
      "text": "5. Ein Losament für 4 Personen in der Weissen Gaß, bestehend aus einem Stüblein und Viehstall, Holz zum Gebrauch auf einem Boden, auf einen Boden, und auch Platz zum Holz, Frühjahr oder Herbst zu beziehen, im Berichthaus zu erfragen."
    },
    {
      "date": "1791-01-31",
      "tags_section": "Es wird zum Ausleihen offeriert:",
      "ntokens": null,
      "text": "6. Ein neues Losament ebendes Haus auf es Stuben, Kammer, Stüblein, einstmals grossem Sommerhaus, Kammer, Kuchen, Keller, Holz zum Gebrauch, auf einem Boden, auf der Vorstadt, auf nächstem Quartal zu beziehen, im Berichthaus zu erfragen."
    },
    {
      "date": "1791-01-31",
      "tags_section": "Es wird zum Ausleihen offeriert:",
      "ntokens": null,
      "text": "7. Ein Stüblein mit einem kleinen Garten in der Vorstadt, auf nächstem Quartal zu beziehen, im Berichthaus zu erfragen."
    },
    {
      "date": "1791-01-31",
      "tags_section": "Es wird zum Ausleihen offeriert:",
      "ntokens": null,
      "text": "8. Ein Stüblein mit einem kleinen Gärtlein, auf nächstem Quartal zu beziehen, im Berichthaus zu erfragen."
    },
    {
      "date": "1791-01-31",
      "tags_section": "Kost, Information und Bedienungen werden angetragen und begehrt:",
      "ntokens": null,
      "text": "1. In ein wackeres protestantisches Haus in dem Niederland wird ein Candidat des Theologie, der neben andern auch die französische Sprach versteht, zu einem Hause, besonders begehrt; ist im Berichthaus zu melden."
    },
    {
      "date": "1791-01-31",
      "tags_section": "Kost, Information und Bedienungen werden angetragen und begehrt:",
      "ntokens": null,
      "text": "2. Man sucht einen Menschen in eine Fabrik, der sich zu allen Haus-Geschäften braucht machen lässt, im Berichthaus zu erfragen."
    },
    {
      "date": "1791-01-31",
      "tags_section": "Kost, Information und Bedienungen werden angetragen und begehrt:",
      "ntokens": null,
      "text": "3. Man sucht einen Stubenkoch in ein Wirtshaus, im Berichthaus zu erfragen."
    }
  ]
}
